import React from "react";

import Product from "../components/products/product.component";
import Navbar from "../components/common/navbar/navbar.component";
import SimilarProducts from "../components/common/similarProducts/similarProducts.component";
import Advert from "../components/common/advert/advert.component";
import Footer from "../components/common/footer/footer.component";

import "./shop.scss";

class Shop extends React.Component {
  render() {
    return (
      <div className="grid">
        <Navbar />
        <Advert />
        <main className="grid__main">
          <div className="container">
            <h1 className="text-center">Shop</h1>
            <div className="product-grid">
              <Product />
              <Product />
              <Product />
              <Product />
            </div>
          </div>
        </main>
        <SimilarProducts />
        <Footer />
      </div>
    );
  }
}

export default Shop;
